Управления МВД России по г.Тольятти Отдел по контролю за оборотом наркотиков сообщает о проведениииОбщероссийской антинаркотической акцит «Сообщи, где торгуют смертью» .

По данным ГБУЗ СО «Тольяттинский наркологический диспансер» на 01.01.2025 года на наркологическом учете с диагнозом «синдром зависимости от наркотических средств» состоит 1529 человек, с диагнозом «пагубное потребление наркотических средств» состоит 1489 человек. 

Отдел по контролю за оборотом наркотиков Управления МВД России по г.Тольятти призывает всех, кто осознает гибельную опасность наркомании, проявить бдительность и принять активное участие в проведении акции – возможно, вы спасете жизнь своих родных и близких. Вся поступающая от граждан информация будет проверена. 

Граждане, располагающие информацией о незаконном обороте наркотических средств и психотропных веществ могут в любое время сообщить информацию на телефоны дежурных частей Управления МВД России по г. Тольятти - 93-43-84, 02; 102/112. 

 Автозаводский район: 
 ОП по Автозаводскому району 1 - 93-45-45; 
 ОП по Автозаводскому району 2 - 93-46-27; 

 Комсомольский район: 
ОП по Комсомольскому району - 93-47-43; 
Центральный район: 
ОП по Центральному району - 93-48-62; 
ОНК У МВД России по г.Тольятти – 48-72-26. 

В период проведения акции действуют телефонные линии органов местного самоуправления с 9 до 17 часов, при участии специалистов в сфере профилактики наркомании, лечения и реабилитации наркозависимых. 

По вопросам первичной профилактики наркомании детей и подростков можно обратиться в МАОУ ДПО Центр информационных технологий по телефону - 95-96-52. 

Консультацию по вопросам лечения и реабилитации наркозависимых можно получить в ГБУЗ СО «Тольяттинский наркологический диспансер» по телефону – 97-77-57; 

Профессиональный психолог МБУ «Многофункциональный Молодежный Центр «Шанс», проконсультирует как справиться с кризисной ситуацией в семье, с 8-00 до 20-00, по телефону доверия - 55-88-77; 

В Общественную приемную администрации городского округа Тольятти можно обратиться по телефону - 54-42-19. 

